import React, { useState, useEffect } from "react";
import ExpensesTable from "../components/Expenses/ExpensesTable";
import { FaUndo, FaFilter } from "react-icons/fa";

const ExpensesPage = () => {
  const [expenses, setExpenses] = useState([]);
  const [filterDate, setFilterDate] = useState("");
  const [filterType, setFilterType] = useState("");

  const fetchData = async () => {
    try {
      const response = await fetch("http://localhost:3000/expenses");
      const data = await response.json();
      setExpenses(data);
    } catch (error) {
      console.error("Error fetching expenses:", error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  const applyFilter = () => {
    let filtered = [...expenses];

    if (filterDate) {
      filtered = filtered.filter((expense) => expense.date === filterDate);
    }

    if (filterType) {
      filtered = filtered.filter((expense) => expense.type === filterType);
    }

    return filtered;
  };

  const resetFilters = () => {
    setFilterDate("");
    setFilterType("");
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-6 text-gray-800">Expenses</h1>

      {/* Filter Bar */}
      <div className="flex items-center gap-4 bg-white p-4 rounded-xl mb-6 shadow-md flex-wrap border border-gray-200">
        <div className="flex items-center gap-2 text-blue-600 font-medium">
          <FaFilter />
          <span>Filter Options</span>
        </div>

        <div className="flex flex-col text-sm">
          <label className="mb-1 text-gray-600 font-medium">Date</label>
          <input
            type="date"
            value={filterDate}
            onChange={(e) => setFilterDate(e.target.value)}
            className="border border-gray-300 rounded-lg px-3 py-2 shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-300"
          />
        </div>

        <div className="flex flex-col text-sm">
          <span className="mb-1 text-gray-600 font-medium">Type</span>
          <div className="flex items-center gap-3">
            <label className="inline-flex items-center gap-1 cursor-pointer">
              <input
                type="radio"
                name="type"
                value="expense"
                checked={filterType === "expense"}
                onChange={(e) => setFilterType(e.target.value)}
                className="accent-red-500"
              />
              <span className="text-red-600 font-medium">Expense</span>
            </label>
            <label className="inline-flex items-center gap-1 cursor-pointer">
              <input
                type="radio"
                name="type"
                value="income"
                checked={filterType === "income"}
                onChange={(e) => setFilterType(e.target.value)}
                className="accent-green-500"
              />
              <span className="text-green-600 font-medium">Income</span>
            </label>
          </div>
        </div>

        <div className="flex gap-2 mt-2 sm:mt-0">
          <button
            onClick={applyFilter}
            className="bg-blue-500 text-white text-sm px-4 py-2 rounded-lg hover:bg-blue-600 transition-shadow shadow-md"
          >
            Apply Filter
          </button>
          <button
            onClick={resetFilters}
            className="flex items-center gap-1 bg-gray-200 text-gray-700 text-sm px-4 py-2 rounded-lg hover:bg-gray-300 transition-shadow shadow-md"
          >
            <FaUndo /> Reset
          </button>
          <button
            onClick={fetchData}
            className="bg-green-500 text-white text-sm px-4 py-2 rounded-lg hover:bg-green-600 transition-shadow shadow-md"
          >
            Refresh
          </button>
        </div>
      </div>

      <ExpensesTable expenses={applyFilter()} />
    </div>
  );
};

export default ExpensesPage;
